B.GB=new A.u5("Wellness Infusion Center Houston","assets/images/houstonlocation.png","7400 Fannin Street, Suite 120 Houston TX, 77054","https://maps.google.com/maps?ll=29.694437,-95.401033&z=10&t=m&hl=en-GB&gl=US&mapclient=embed&q=7400%20Fannin%20St%20%23120%20Houston%2C%20TX%2077054%20USA",null)
B.GC=new A.u5("Wellness Infusion Center Webster","assets/images/websterlocation.jpg","711 West Bay Area Blvd., Suite 525 Webster TX 77598","https://maps.google.com/maps?ll=29.54315,-95.135197&z=10&t=m&hl=en-GB&gl=US&mapclient=embed&q=711%20Bay%20Area%20Blvd%20Webster%2C%20TX%2077598%20USA",null)
B.GE=new A.ke("Do not wear any fragrance or perfume, other patients and or staff may be allergic and or can cause reaction at injection site.","assets/images/perfume.png",null)
B.GF=new A.ke("Bring a complete list of current medications, allergies, and emergency contact information for the infusion staff to add to your chart.","assets/images/pill.png",null)
B.GG=new A.ke("Drink plenty of water to be sure you are well hydrated. If you have a heart condition, kidney condition or any other health condition that prevents you from drinking large amounts of fluid, check with your healthcare practitioner for instructions on how to hydrate before your infusion procedure.","assets/images/bottle.png",null)
B.GH=new A.ke("Wear comfortable loose fitting clothes. You will want to be comfortable, and most likely your vital signs will monitored (for example, blood pressure, heart rate, respiratory rate (breathing  rate), or a cardiac monitor may be attached to your chest). Every infusion center is different, so check with yours in regard to what to expect. Wearing loose fitting clothes allows the medical staff to easily and properly monitor your vital signs.","assets/images/comfortclothes.png",null)
B.GI=new A.ke("Our infusion centers will provide blankets, pillows, water and coffee. Check to see what other items the center provides in case they do not offer something that will make you more comfortable.","assets/images/pillow.png",null)
B.GJ=new A.ke("Consider wearing clothing with layers to allow for temperature control. The temperature of the infusion center may be cool or warm; also some intravenous infusions can make you feel either warm or cool. Having layers of clothing allows you the flexibility too easily control your comfort zone.","assets/images/comfortclothes.png",null)
B.GK=new A.ke("Some infusions may require that you pre-medicate with medications such as acetaminophen, (Tylenol). Check with the infusion staff regarding any pre-medications you need to take prior to your infusion, the dose, and the best time to take the medications.","assets/images/premedication.png",null)
